import React, { useState, useEffect } from "react";
import "./App.css";

function App() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [latestData, setLatestData] = useState(null);
  const [historyData, setHistoryData] = useState([]);

  // Login Handler
  const handleLogin = async () => {
    try {
      const response = await fetch("http://localhost:3001/api/login", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ username, password }),
      });

      const data = await response.json();
      if (response.ok) {
        setIsAuthenticated(true);
        alert("Login successful!");
      } else {
        alert(data.message || "Login failed");
      }
    } catch (error) {
      console.error("Error logging in:", error);
      alert("Login failed");
    }
  };

  // Fetch the latest data
  useEffect(() => {
    if (isAuthenticated) {
      fetch("http://localhost:3001/api/temperature")
        .then((response) => response.json())
        .then((data) => setLatestData(data))
        .catch((error) => console.error("Error fetching latest data:", error));
    }
  }, [isAuthenticated]);

  // Fetch historical data
  useEffect(() => {
    if (isAuthenticated) {
      fetch("http://localhost:3001/api/history")
        .then((response) => response.json())
        .then((data) => setHistoryData(data))
        .catch((error) => console.error("Error fetching historical data:", error));
    }
  }, [isAuthenticated]);

  return (
    <div className="App">
      {!isAuthenticated ? (
        <div>
          <h2>Login</h2>
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <button onClick={handleLogin}>Login</button>
        </div>
      ) : (
        <div>
          <header className="App-header">
            <h1>Temperature and Humidity Monitor</h1>
          </header>
          <main>
            <section>
              <h2>Latest Data</h2>
              {latestData ? (
                <div>
                  <p>Temperature: {latestData.temperature}°C</p>
                  <p>Humidity: {latestData.humidity}%</p>
                  <p>Timestamp: {new Date(latestData.timestamp).toLocaleString()}</p>
                </div>
              ) : (
                <p>Loading latest data...</p>
              )}
            </section>
            <section>
              <h2>Historical Data (Last 50 Records)</h2>
              {historyData.length > 0 ? (
                <table>
                  <thead>
                    <tr>
                      <th>Timestamp</th>
                      <th>Temperature (°C)</th>
                      <th>Humidity (%)</th>
                    </tr>
                  </thead>
                  <tbody>
                    {historyData.map((record, index) => (
                      <tr key={index}>
                        <td>{new Date(record.timestamp).toLocaleString()}</td>
                        <td>{record.temperature}</td>
                        <td>{record.humidity}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              ) : (
                <p>Loading historical data...</p>
              )}
            </section>
          </main>
        </div>
      )}
    </div>
  );
}

export default App;
